(3175,	1,	'admin/modules/2',	'PUT',	'213.129.97.162',	'{\"id\":\"2\",\"name\":\"\\u041e\\u0440\\u0433\\u0430\\u043d\\u0438\\u0437\\u0443\\u044e\\u0449\\u0430\\u044f \\u0441\\u0445\\u0435\\u043c\\u0430\",\"content\":\"<!DOCTYPE html>\\r\\n<html>\\r\\n<head>\\r\\n<\\/head>\\r\\n<body>\\r\\n<h2>\\u041f\\u0440\\u0435\\u0434\\u0441\\u0442\\u0430\\u0432\\u043b\\u0435\\u043d\\u0430 \\u0432 \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u0435 ASMX<\\/h2>\\r\\n<p><img src=\\\"storage\\/img\\/9.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>\\u042d\\u0442\\u043e \\u0438\\u0435\\u0440\\u0430\\u0440\\u0445\\u0438\\u0447\\u0435\\u0441\\u043a\\u0430\\u044f \\u0441\\u0442\\u0440\\u0443\\u043a\\u0442\\u0443\\u0440\\u0430 \\u043a\\u043e\\u043c\\u043f\\u0430\\u043d\\u0438\\u0438 \\u0441 \\u043f\\u043e\\u0434\\u0440\\u0430\\u0437\\u0434\\u0435\\u043b\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438 \\u0438 \\u0434\\u043e\\u043b\\u0436\\u043d\\u043e\\u0441\\u0442\\u044f\\u043c\\u0438. \\u042d\\u0442\\u043e \\u0440\\u0430\\u0441\\u043f\\u0440\\u0435\\u0434\\u0435\\u043b\\u0435\\u043d\\u0438\\u0435 \\u043e\\u0431\\u044f\\u0437\\u0430\\u043d\\u043d\\u043e\\u0441\\u0442\\u0435\\u0439 \\u0438 \\u043f\\u043e\\u043b\\u043d\\u043e\\u043c\\u043e\\u0447\\u0438\\u0439 \\u0432\\u043d\\u0443\\u0442\\u0440\\u0438 \\u043f\\u0440\\u0435\\u0434\\u043f\\u0440\\u0438\\u044f\\u0442\\u0438\\u044f.&nbsp;<\\/p>\\r\\n<p>\\u041e\\u0440\\u0433\\u0441\\u0445\\u0435\\u043c\\u0430 \\u043f\\u043e\\u043a\\u0430\\u0437\\u044b\\u0432\\u0430\\u0435\\u0442, \\u0433\\u0434\\u0435 \\u0438 \\u043a\\u0442\\u043e &laquo;\\u0441\\u0442\\u043e\\u0438\\u0442&raquo; \\u0432 \\u043a\\u0430\\u0440\\u044c\\u0435\\u0440\\u043d\\u043e\\u0439 \\u043b\\u0435\\u0441\\u0442\\u043d\\u0438\\u0446\\u0435 \\u0438 \\u043a\\u0442\\u043e \\u0437\\u0430 \\u0447\\u0442\\u043e \\u043e\\u0442\\u0432\\u0435\\u0447\\u0430\\u0435\\u0442. \\u041a\\u043e\\u0433\\u0434\\u0430 \\u0447\\u0435\\u043b\\u043e\\u0432\\u0435\\u043a \\u043d\\u0430\\u0433\\u043b\\u044f\\u0434\\u043d\\u043e \\u0432\\u0438\\u0434\\u0438\\u0442, \\u0432 \\u043a\\u0430\\u043a\\u043e\\u0439 \\u043f\\u043e\\u0437\\u0438\\u0446\\u0438\\u0438 \\u0441\\u0442\\u043e\\u0438\\u0442 \\u043e\\u043d \\u0432 \\u043a\\u043e\\u043c\\u043f\\u0430\\u043d\\u0438\\u0438, \\u0442\\u043e\\u0433\\u0434\\u0430 \\u043e\\u043d \\u0447\\u0451\\u0442\\u043a\\u043e \\u043f\\u043e\\u043d\\u0438\\u043c\\u0430\\u0435\\u0442, \\u043a\\u0430\\u043a\\u0438\\u0435 \\u0444\\u0443\\u043d\\u043a\\u0446\\u0438\\u0438 \\u043e\\u043d \\u0434\\u043e\\u043b\\u0436\\u0435\\u043d \\u0432\\u044b\\u043f\\u043e\\u043b\\u043d\\u044f\\u0442\\u044c \\u0438 \\u043a\\u0430\\u043a \\u044d\\u0442\\u043e \\u0443\\u0441\\u043f\\u0435\\u0448\\u043d\\u0435\\u0435 \\u0441\\u0434\\u0435\\u043b\\u0430\\u0442\\u044c.<\\/p>\\r\\n<p>\\u041e\\u0440\\u0433\\u0430\\u043d\\u0438\\u0437\\u0443\\u044e\\u0449\\u0430\\u044f \\u0441\\u0445\\u0435\\u043c\\u0430 \\u043f\\u0440\\u0435\\u0434\\u043f\\u0440\\u0438\\u044f\\u0442\\u0438\\u044f \\u043f\\u043e\\u043c\\u043e\\u0433\\u0430\\u0435\\u0442 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043c\\u0430\\u0442\\u0438\\u0437\\u0438\\u0440\\u043e\\u0432\\u0430\\u0442\\u044c \\u0440\\u0430\\u0431\\u043e\\u0442\\u0443, \\u0440\\u0430\\u0441\\u043f\\u0440\\u0435\\u0434\\u0435\\u043b\\u044f\\u0442\\u044c \\u0435\\u0451, \\u0430 \\u0433\\u043b\\u0430\\u0432\\u043d\\u043e\\u0435 &ndash; \\u043f\\u043e\\u0432\\u044b\\u0441\\u0438\\u0442\\u044c \\u043a\\u0430\\u0447\\u0435\\u0441\\u0442\\u0432\\u043e \\u0440\\u0430\\u0431\\u043e\\u0442\\u044b. \\u041e\\u043d\\u0430 \\u044f\\u0432\\u043b\\u044f\\u0435\\u0442\\u0441\\u044f \\u043e\\u0441\\u043d\\u043e\\u0432\\u043e\\u0439 \\u0434\\u043b\\u044f \\u043d\\u0435\\u0441\\u043a\\u043e\\u043b\\u044c\\u043a\\u0438\\u0445 \\u0432\\u0430\\u0436\\u043d\\u044b\\u0445 \\u0440\\u0435\\u0436\\u0438\\u043c\\u043e\\u0432 \\u0440\\u0430\\u0431\\u043e\\u0442\\u044b \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u044b ASMX &ndash; \\u0438\\u043d\\u0444\\u043e\\u0440\\u043c\\u0430\\u0446\\u0438\\u043e\\u043d\\u043d\\u044b\\u0439, \\u043a\\u043e\\u043c\\u043c\\u0443\\u043d\\u0438\\u043a\\u0430\\u0446\\u0438\\u043e\\u043d\\u043d\\u044b\\u0439 \\u0446\\u0435\\u043d\\u0442\\u0440\\u044b, \\u043e\\u0440\\u0433\\u0430\\u043d\\u0438\\u0437\\u0443\\u044e\\u0449\\u0430\\u044f \\u0441\\u0445\\u0435\\u043c\\u0430 \\u0444\\u0443\\u043d\\u043a\\u0446\\u0438\\u043e\\u043d\\u0430\\u043b\\u0430.<\\/p>\\r\\n<p><img src=\\\"storage\\/img\\/org.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>\\u041e\\u0440\\u0433\\u0441\\u0445\\u0435\\u043c\\u0430 \\u0441\\u043e\\u0441\\u0442\\u043e\\u0438\\u0442 \\u0438\\u0445 \\u0434\\u0432\\u0443\\u0445 \\u0442\\u0438\\u043f\\u043e\\u0432 \\u044d\\u043b\\u0435\\u043c\\u0435\\u043d\\u0442\\u043e\\u0432: \\u0434\\u043e\\u043b\\u0436\\u043d\\u043e\\u0441\\u0442\\u0438 \\u0438 \\u043f\\u043e\\u0434\\u0440\\u0430\\u0437\\u0434\\u0435\\u043b\\u0435\\u043d\\u0438\\u0439. \\u0414\\u043e\\u043b\\u0436\\u043d\\u043e\\u0441\\u0442\\u0438 \\u0432\\u0441\\u0435\\u0433\\u0434\\u0430 \\u043d\\u0430\\u0445\\u043e\\u0434\\u044f\\u0442\\u0441\\u044f \\u0432\\u043d\\u0443\\u0442\\u0440\\u0438 \\u043a\\u0430\\u043a\\u0438\\u0445-\\u043b\\u0438\\u0431\\u043e \\u043f\\u043e\\u0434\\u0440\\u0430\\u0437\\u0434\\u0435\\u043b\\u0435\\u043d\\u0438\\u0439. \\u041f\\u043e\\u0434\\u0440\\u0430\\u0437\\u0434\\u0435\\u043b\\u0435\\u043d\\u0438\\u044f \\u043c\\u043e\\u0433\\u0443\\u0442 \\u0434\\u0435\\u043b\\u0438\\u0442\\u044c\\u0441\\u044f \\u043d\\u0430 \\u0441\\u0435\\u043a\\u0446\\u0438\\u0438 \\u0438 \\u0441\\u0435\\u043a\\u0442\\u043e\\u0440\\u0430. \\u041f\\u043e \\u043a\\u0430\\u0436\\u0434\\u043e\\u0439 \\u0434\\u043e\\u043b\\u0436\\u043d\\u043e\\u0441\\u0442\\u0438 \\u0432 \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u0435 ASMX \\u043c\\u043e\\u0436\\u043d\\u043e \\u043f\\u0440\\u043e\\u0441\\u043c\\u043e\\u0442\\u0440\\u0435\\u0442\\u044c \\u043e\\u0441\\u043d\\u043e\\u0432\\u043d\\u043e\\u0439 \\u0444\\u0443\\u043d\\u043a\\u0446\\u0438\\u043e\\u043d\\u0430\\u043b, \\u0446\\u0435\\u043d\\u043d\\u044b\\u0439 \\u043a\\u043e\\u043d\\u0435\\u0447\\u043d\\u044b\\u0439 \\u043f\\u0440\\u043e\\u0434\\u0443\\u043a\\u0442, \\u0430 \\u0442\\u0430\\u043a\\u0436\\u0435 \\u043a\\u043e\\u043d\\u0442\\u0430\\u043a\\u0442\\u043d\\u044b\\u0435 \\u0434\\u0430\\u043d\\u043d\\u044b\\u0435 \\u043b\\u0438\\u0446\\u0430 (\\u0442\\u0435\\u043b\\u0435\\u0444\\u043e\\u043d, e-mail), \\u0437\\u0430\\u043d\\u0438\\u043c\\u0430\\u044e\\u0449\\u0435\\u0433\\u043e \\u0442\\u0443 \\u0438\\u043b\\u0438 \\u0438\\u043d\\u0443\\u044e \\u0434\\u043e\\u043b\\u0436\\u043d\\u043e\\u0441\\u0442\\u044c.&nbsp;<\\/p>\\r\\n<p><img src=\\\"storage\\/img\\/org2.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<\\/body>\\r\\n<\\/html>\",\"_token\":\"kf9ruX8ewb6FcgioMEW0OSSJ1Yu5IUNExKSlwVaT\",\"_method\":\"PUT\"}',	'2018-08-23 08:43:14',	'2018-08-23 08:43:14'),
