(9,	'Грунтовка',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Грунтовка &ndash; это качественная основа любых отделочных работ. А грунтование &ndash; основной этап подготовки поверхности к последующему нанесению финишного покрытия.</p>\r\n<p>Грунтовки повышают&nbsp;<a href=\"../../../programs/1/wiki\">адгезию (сцепление)</a>&nbsp;последующих материалов с основанием, снижают расход, повышают качество и увеличивают срок службы финишных составов, выравнивают впитывающую способность основания и обеспыливают поверхность.</p>\r\n<p>Грунтовка, в зависимости от типа и назначения, проникает в поверхность, укрепляет ее, способствует равномерному нанесению таких материалов, как краски, штукатурки, обойный и плиточный клеи, шпатлевки, уменьшает расход краски, предотвращает появление плесени и грибка.</p>\r\n</body>\r\n</html>',	NULL,	12,	0,	'2018-09-12 08:35:57',	'2018-09-12 09:32:41',	0),
(10,	'Грунтовкаа',	'Грунтовка',	NULL,	12,	0,	'2018-09-12 09:31:21',	'2018-09-12 09:31:21',	0),
